  console.log(searchParams.get("name"), searchParams.get("page"), searchParams.get("sort"));

  const set = () => {
    setSearchParams((prev) => {
      prev.set("someKey", "someValue");
      return prev;
    });
  };

  console.log(set);
  

  return (
    <div>
      <div>PizzaDetails</div>
      <button onClick={()=> set}> set</button>
    </div>
  );
};
